import css from './TransactionHistory.module.css';

export const TransactionHistory = ({ item: { type, amount, currency , id } }) => {
    return (
        <table className={css.transaction}>
  <thead>
    <tr>
      <th>Type</th>
      <th>Amount</th>
      <th>Currency</th>
    </tr>
  </thead>

  <tbody>
    <tr>
      <td>{type}</td>
      <td>{amount}</td>
      <td>{currency}</td>
    </tr>
  </tbody>
</table>
    );
};
